dfCovidCases_renamed_updated.head()

"""Reshaping the above dataframe for total number of cases for each state """

dfCovidCases_renamed_updated = dfCovidCases_renamed_updated.pivot(index='Month', columns='state', values='Total_No_of_Cases')
