"""## **Machine Learning Classification**

First approach that we will use to predict vaccines or cases, is we will sample the data with respect to state, year and month. We will write a logic, that will prepare the data model for us. We will use the same model that we used to find the relation between vaccine and covid cases.

First we will find the total Total_No_of_Cases, Number_of_New_Cases,Total_Number_of_Death by state, year and month.
"""

df_cases_by_month_state = dfCovidCases_renamed.groupby(['state', 'Year', 'Month']).sum().reset_index()
df_cases_by_month_state = df_cases_by_month_state[['state', 'Year', 'Month', 'Total_No_of_Cases', 'Number_of_New_Cases', 'Total_Number_of_Death']]
df_cases_by_month_state.head()

"""Now calculate the Series_Complete_Yes, POP_12-17_Vaccinated, POP_18-65_Vaccinated, Series_Complete_65Plus with respect to state, year and month."""

dfVaccines_by_month_state = dfVaccines_renamed.groupby(['Recipient_State', 'Year', 'Month']).sum().reset_index()
dfVaccines_by_month_state = dfVaccines_by_month_state[['Recipient_State', 'Year', 'Month', 'Series_Complete_Yes', 'POP_12-17_Vaccinated', 'POP_18-65_Vaccinated', 'Series_Complete_65Plus']]
dfVaccines_by_month_state = dfVaccines_by_month_state.rename(columns={'Recipient_State' : 'state'})
dfVaccines_by_month_state.head()

"""Now calculate the column 'running_new_cases' column by using Number_of_New_Cases of dataset df_cases_by_month_state by this newly created we can recognize either the covid cases increased or decreased"""

# df_new_covid_cases_by_states_month['Running_New_Cases'] = df_new_covid_cases_by_states_month['Number_of_New_Cases'].cumsum()
df_cases_by_month_state['Running_New_Cases'] = df_cases_by_month_state['Number_of_New_Cases'].diff(periods=1) 
df_cases_by_month_state = df_cases_by_month_state.fillna(0) 
df_cases_by_month_state.loc[df_cases_by_month_state['Running_New_Cases'] > 0, 'New_Case_Inc_Dec'] = 'Increased'
df_cases_by_month_state.loc[df_cases_by_month_state['Running_New_Cases'] < 0, 'New_Case_Inc_Dec'] = 'Decreased'
df_cases_by_month_state.head(10)

"""In this step we will merge the dataset of covid vaccines and covid cases and then save the dataset in the csv so I can use this dataset in weka KNN classification"""

df_cases_by_month_state = df_cases_by_month_state.merge(dfVaccines_by_month_state)
df_cases_by_month_state.head(20)

df_cases_by_month_state.to_csv('data_covid_cases_vaccines.csv')

